import React from 'react';
import { WebSocketProvider } from './context/WebSocketContext';
import Canvas from './components/Canvas';

const App = () => (
  <WebSocketProvider>
    <h1>Collaborative Canvas Frontend</h1>
    <Canvas />
  </WebSocketProvider>
);

export default App;
